import React, { useState } from 'react';
import PriceRangeSlider from './PriceRangeSlider';
import PropertyType from './PropertyType';

const propertyTypes = ['House', 'Apartment', 'Condo'];

const Main = () => {
  const [priceRange, setPriceRange] = useState([1000, 3000]);
  const [propertyType, setPropertyType] = useState('');

  const handlePriceRangeChange = (newValue) => {
    setPriceRange(newValue);
  };

  const handlePropertyTypeChange = (newValue) => {
    setPropertyType(newValue);
  };

  return (
    <div>
      <PriceRangeSlider value={priceRange} onChange={handlePriceRangeChange} />
      <PropertyType
        value={propertyType}
        onChange={handlePropertyTypeChange}
        propertyTypes={propertyTypes}
      />
    </div>
  );
};

export default Main;
